  true,\n\t\"url\": null,\n\t\"notes\": \"The Director of the Office of Energy Policy
  and Systems Analysis is the primary energy policy advisor to the Secretary and Deputy
  Secretary on domestic energy policy development and implementation as well as DOE
  policy analysis and activities.rnrnThe role of the Office of Energy Policy and Systems
  Analysis is to deliver unbiased energy analysis to the Department of Energy's leadership
  on existing and prospective energy-related policies, focusing in part on integrative
  analysis of energy systems.rnrnThe Office of Energy Policy and Systems Analysis
  includes the Secretariat of the Quadrennial Energy Review with primary responsibility
  for supporting the White House interagency process and providing to it data collection,
  analysis, stakeholder engagement, and data synthesis.\",\n\t\"license_title\": \"Creative
